import { Search as SearchIcon } from "@mui/icons-material";
import { InputBase,Box } from "@mui/material";


const Component=styled(Box)`
background:#fff;
height:45px;
border-bottom:1
`
const Search=()=>{
    return(
        <Component>
            <Box>
                <Box>
                    <SearchIcon/>
                </Box>
                <InputBase/>
            </Box>
        </Component>
    )
}
export default Search;
